import React from "react";

const Container = (props) => {
  return (
    <div>
      <ol className="a">
        {props.todo.map(index, todo)}
        <li className="listItem" key={index}>
          <div>
            <span>{todo.text}</span>
          </div>
        </li>
      </ol>
    </div>
  );
};
export default Container;
